def insert_spaces_at_intervals(numbers):
    # Convert all numbers to strings for easier manipulation
    numbers_str = [str(num) for num in numbers]
    # Initialize an empty string to hold the result
    result = ""
    # Iterate through the list of string numbers
    for i, num in enumerate(numbers_str, start=1):
        result += num
        # After every 10th number, add a space
        if i % 10 == 0:
            result += " "
    return result

# Example usage
numbers = ""
formatted_sequence = insert_spaces_at_intervals(numbers)
print(formatted_sequence)